import React from "react";
import "../styles/About.css";
import FadeInSection from "./FadeInSection";

class About extends React.Component {
  constructor() {
    super();
    this.state = {
      expanded: true,
      activeKey: "1"
    };
    this.handleSelect = this.handleSelect.bind(this);
  }
  handleSelect(eventKey) {
    this.setState({
      activeKey: eventKey
    });
  }
  render() {
    const one = (
      <p>
        I am currently a <b>Student</b> at
        <a href="https://www.unc.edu/"> UNC Chapel Hill</a>, double majoring in 
        Information Science and Computer Science with a minor in Data Science. At the same time, I am undertaking a
        part-time <b> Master's of Science</b> in <b>Software Engineering </b>at{" "}
        <a href="https://www.ox.ac.uk/about">University of Oxford</a>.
      </p>
    );
    const two = (
      <p>
        Outside of school, I'm interested in following the developments of //FIXME:
        science. I also play a lot of video games. And make TikToks.
      </p>
    );

    const tech_stack = [
      "Typescript",
      "Python",
      "React.js",         //FIXME:
      "Java",
      "Javascript ES6+",
      "C"
    ];

    return (
      <div id="about">
        <FadeInSection>
          <div className="section-header ">
            <span className="section-title">/ about me</span>
          </div>
          <div className="about-content">
            <div className="about-description">
              {[one]}
              {"Here are some technologies I have used:"}         //FIXME:
              <ul className="tech-stack">
                {tech_stack.map(function (tech_item, i) {
                  return (
                    <FadeInSection delay={`${i + 1}00ms`}>
                      <li>{tech_item}</li>
                    </FadeInSection>
                  );
                })}
              </ul>
              {[two]}
            </div>
            <div className="about-image">
              <img alt="Li-La Youn" src={"/assets/ranch.png"} />                                       //FIXME:
            </div>
          </div>
        </FadeInSection>
      </div>
    );
  }
}

export default About;
